        <style>

                }

                const date = new Date();

                const y = date.getFullYear();
                const m = date.getMonth();
                const d = date.getDate();

                document.getElementById("date").textContent = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"][m] + " " + d + ", " + y;

                const seed = y * 384 + m * 32 + d;

                const crcTable = [];

                for (let i = 0; i < 256; i++) {
                    let c = i;

                    for (let k = 0; k < 8; k++) {
                        c = c & 1 ? 0xedb88320 ^ (c >>> 1) : c >>> 1;
                    }

                    crcTable[i] = c;
                }

                function crc32(str) {
                    let crc = -1;

                    for (let i = 0; i < str.length; i++) {
                        crc = (crc >>> 8) ^ crcTable[(crc ^ str.charCodeAt(i)) & 0xff];
                    }

                    return (crc ^ -1) >>> 0;
                }

                const word = scrabbleDict[crc32(seed.toString()) % scrabbleDict.length];

                function isWord(str) {
                    return str.length == 1 && str >= 'a' && str <= 'z' || scrabbleDict.includes(str);
                }

                const input = document.getElementById("guess");
                const counter = document.getElementById("counter");

                let count = 1;
                const grays = [];

                const sharebox = document.getElementById("sharebox");

                input.addEventListener("keydown", function(event) {
                    if ((event.code == "Enter" || event.code == "Return" || event.code == "NumpadEnter") && !event.ctrlKey && !event.altKey && !event.metaKey && !event.shiftKey) {
                        const guess = input.value.trim().toLowerCase();

                        if (!isWord(guess)) {
                            alert("'" + guess[0].toUpperCase() + guess.slice(1) + "' is not a known word.");

                            return;
                        }

                        input.value = "";

                        const row = document.createElement("div");

                        document.getElementById("grid").appendChild(row);

                        const tiles = [];
                        const spare = [...word];

                        let gray = 0;

                        for (let i = 0; i < guess.length; i++) {
                            const tile = document.createElement("div");

                            row.appendChild(tile);
                            tiles.push(tile);

                            tile.textContent = guess[i].toUpperCase();

                            if (guess[i] == word[i]) {
                                tile.classList.add("correct");
                                spans[guess[i]].classList.add("correct");
                                spare[i] = null;
                            } else {
                                spans[guess[i]].classList.add("wrong");
                                gray++;
                            }
                        }

                        for (let i = 0; i < guess.length; i++) {
                            const index = spare.indexOf(guess[i]);

                            if (index != -1 && guess[i] != word[i]) {
                                tiles[i].classList.add("close");
                                spans[guess[i]].classList.add("close");
                                spare[index] = null;
                                gray--;
                            }
                        }

                        grays.push(gray);

                        if (guess == word) {
                            input.disabled = true;
                            setTimeout(alert, 0, "You got it! The word was '" + word + "'.");
                            counter.style.color = "#00aa00";

                            document.getElementById("share").style.display = "block";
                            sharebox.value = "Unboundle: " + document.getElementById("date").textContent + "\n" + count + "/6\n\n" + grays.map(g => "⬜×" + g).join("\n") + "\n\nhttps://ryantosh.github.io/unboundle";
                        } else {
                            counter.textContent = ++count;
                            counter.style.color = "hsl(0, 100%, " + Math.min((130 - (count - 1) * 17.5), 100) + "%)";
                            
                            if (word.startsWith(guess)) {
                                const cdots = document.createElement("div");
                                row.appendChild(cdots);

                                cdots.classList.add("cdots");
                                cdots.textContent = "\xb7\xb7\xb7";
                            }

                            if (count == 7) {
                                input.disabled = true;
                                setTimeout(alert, 0, "Better luck next time. The word was '" + word + "'!");
                                counter.textContent = "-";
                            }
                        }
                    }
                });

                sharebox.addEventListener("click", function() {
                    sharebox.select();
                });

                input.focus();
            })();
        </script>
    </body>
</html>
